measurements.description:
One magnificent flat flower on one pendent inflorescence;

	dorsal sepal chartreuse, black suffusion in starburst pattern proximally, extremely saturated black overall, cauda black;
	lateral sepals chartreuse with apricot suffusion proximally, extreme black suffusion overall, caudae black;
	petals chartreuse, tipped black;
	lip cream, lightly suffused laveder, lavender veins; 	

	substance very hard; texture papulose.
